import styled from 'styled-components';

export const Container = styled.div`
    display: flex;
    min-height: calc(100vh - 80px);
    padding: 0;
    background: linear-gradient(
        108deg,
        rgba(11, 83, 69 ) 0%,
        rgba(23, 165, 137) 100%
    );
`

export const Wrap = styled.div`
    margin: 50px auto; 
`
